import LogItem from "./LogItem"
import './Logs.css'

const Logs = () => {

  const logs_data = [
    {
      date: new Date(),
      desc: "学习React",
      during: 30
    },
    {
      date: new Date(),
      desc: "学习Vue",
      during: 20
    },
    {
      date: new Date(),
      desc: "学习Java",
      during: 40
    },
  ]

  return (<div className="log">
    {/* 组件内部自定义一些属性名称，并给予属性相应的内容 */}

    {/* 对logs_data进行遍历 */}
    {/* {logs_data.map(item => < LogItem date={item.date} desc={item.desc} during={item.during} />)} */}

    {/* 将循环列表后面的数据作为参数传递进去 */}
    const log_data = item => < LogItem date={item.date} desc={item.desc} during={item.during} />
  </div>)
}

export default Logs
